import React from 'react'
import './css/Project.scss'
import ProjectCard from './ProjectCard'
import hackernews from './assets/hackernews-icon.png';
import spotify from './assets/spotify-icon.png';
import covid19 from './assets/covid-dashboard-icon.png';
import opyn from './assets/eth-icon.png';
import pineapple from './assets/pineapple-logo.svg';


function Project() {
    return (
        <div className="projects" id="project"> 
            {/* <h2>Projects</h2> */}
            <div className="card-container">
                <ProjectCard 
                    index={0}
                    title="Hacker News"
                    description="News for Developers" 
                    image={hackernews}
                />
                <ProjectCard 
                    index={1}
                    title="Spotify Lyrics"
                    description="Spotify Player with Lyrics" 
                    image={spotify}
                /> 
                <ProjectCard 
                    index={2}
                    title="COVID-19 Dashboard"
                    description="COVID-19 Stats Visualizer" 
                    image={covid19}
                />
                <ProjectCard 
                    index={3}
                    title="Opyn Dex"
                    description="Decentralized Excange UI" 
                    image={opyn}
                />
                <ProjectCard 
                    index={4}
                    title="Pineapple Finance"
                    description="Yeild Optimizer on Etherium" 
                    image="https://iconape.com/wp-content/png_logo_vector/hackernews.png"
                />
                <ProjectCard 
                    index={5}
                    title="Hacker News"
                    description="News for Developers" 
                    image={hackernews}
                /> 
            </div>
        </div>
    )
}

export default Project
